import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Home from './Home'; // Importa el componente Home (o cualquier otro componente que desees asociar a una ruta)
import Contacto from './Contacto'; // Importa el componente Contacto (si tienes uno)
import Favoritos from './Favoritos'; // Importa el componente Favoritos (si tienes uno)

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route exact path="/home" component={Home} /> {/* Ruta para la página de inicio */}
          <Route exact path="/contacto" component={Contacto} /> {/* Ruta para la página de contacto */}
          <Route exact path="/favs" component={Favoritos} /> {/* Ruta para la página de favoritos */}
          {/* Agrega más rutas y componentes según sea necesario */}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
